// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

//    (CSV)    ,
// IPFS    (Hash/CID) 
// Gas      .

contract AircraftMaintenanceHistory {

    // IPFS Hash   ( Hash  ID )
    uint256 private fileIdCounter = 0;

    // fileId( ID) => IPFS Content Identifier (CID, Hash) .
    mapping(uint256 => string) public fileHashes;

    //   
    address[] public admins;

    //   Hash    
    event FileHashRecorded(uint256 fileId, string ipfsHash);

    // :      .
    constructor(address[] memory _admins) {
        setAdmins(_admins);
    }

    //       
    modifier onlyAdmin() {
        require(isAdmin(msg.sender), "Only admin can call this function");
        _;
    }

    // ---    ---
    function isAdmin(address addr) private view returns (bool) {
        for (uint256 i = 0; i < admins.length; i++) {
            if (admins[i] == addr) {
                return true;
            }
        }
        return false;
    }

    function setAdmins(address[] memory _admins) private {
        require(_admins.length > 0, "At least one admin address is required");
        admins = _admins;
    }

    // ---  Gas  : IPFS Hash  ---
    //   CSV   ,    IPFS Hash(CID) .
    //  Gas    .
    function addFileHash(string memory _ipfsHash) public onlyAdmin returns (uint256) {
        // Hash     
        require(bytes(_ipfsHash).length > 0, "IPFS Hash cannot be empty");

        fileIdCounter++; 
        uint256 newFileId = fileIdCounter;

        //    ID IPFS Hash .
        //      .
        fileHashes[newFileId] = _ipfsHash;

        emit FileHashRecorded(newFileId, _ipfsHash);

        return newFileId;
    }

    // ---  : IPFS Hash  ---
    // ID   IPFS Hash(CID) . 
    function getFileHash(uint256 _fileId) public view returns (string memory) {
        string memory ipfsHash = fileHashes[_fileId];
        // Hash  0  ID   .
        require(bytes(ipfsHash).length > 0, "File ID does not exist");
        return ipfsHash;
    }
}
